Witchblade #148-158
Publisher:  Image Comics
Publication Date:  September 28, 2011 - July 25, 2012

Witchblade #148
Despite her most valiant efforts, Sara Pezzini succumbs to the mythic power of the Babylonian God-Queen Tiamat. With the Balance out of the way, will Tiamat remake New York in her serpantine image?

Witchblade #149
The epic battle between Sara Pezzini, bearer of the Witchblade, and Tiamat, the ancient Babylonian Queen-Goddess culminates in an earth-shaking showdown! The ongoing team of RON MARZ (Artifacts, Magdalena) and STJEPAN SEJIC (Angelus) inch closer to the huge anniversary #150 issue!

Witchblade #150
END OF AN ERA! WITCHBLADE reaches its landmark one hundred-fiftieth issue! The series reaches another landmark as long time writer RON MARZ and artist STJEPAN SEJIC put a final stamp on the series they helped define for the modern reader with their final issue.

Witchblade #151
DAWN OF A NEW ERA! Forever altered by the events of ARTIFACTS, Sara finds herself in a completely foreign situation and surroundings. The mystery of how and why will compel readers for the coming year and beyond!

Witchblade #152
Tracking supernatural killers was a lot easier when Sara Pezzini, bearer of the Witchblade, lived in her hometown of New York and was a police detective. Now she must do it while avoiding butting heads with the Chicago PD and trying to make ends meet as a private detective. The new creative team of TIM SEELEY (HACK/SLASH) and DIEGO BERNARD (The Man With No Name) continue to shake up the status quo of WITCHBLADE! Featuring two covers by JOHN TYLER CHRISTOPHER (ARTIFACTS) and DIEGO BERNARD!

Witchblade #153
The new creative team of TIM SEELEY (HACK/SLASH) and DIEGO BERNARD (The Man With No Name) smash occult and biker culture together as Sara is dragged deeper into the supernatural underbelly of Chicago by a coven of biker witches!

Witchblade #154
Sara Pezzini only wants to repay Cain Jorgonson by rescuing him, but the cult of the mysterious Fleshblade stands firmly in her way. The new creative team of TIM SEELEY (HACK/SLASH) and DIEGO BERNARD (The Man With No Name) continue their genre bending run on WITCHBLADE!

Witchblade #155
Sara Pezzini only wants to repay Cain Jorgonson by rescuing him, but the cult of the mysterious Fleshblade stands firmly in her way. The new creative team of TIM SEELEY (HACK/SLASH, BLOODSTRIKE) and DIEGO BERNARD (The Man With No Name) conclude their genre bending first arc on WITCHBLADE as Sara finds herself caught between a Chicago feud much older than she ever suspected! Can Sara protect an innocent cop and save a poseur magician and bring two opposing gangs to justice?

Witchblade #156
Sara Pezzini thought she had reached an understanding with Chicago P.D.'s Jane &quot;Big Woz&quot; Wosnicki, but clearly she was mistaken. In order to protect her secret life, Pezzini will agree to help solve a personal problem for Woz, which will inadvertently lead her to discover another aspect of Chicago's supernaturally corrupt nature.

Witchblade #157
Even as she struggles to make ends meet as a PI, Sara Pezzini can't help but be drawn into the corrupt supernatural underbelly of Chicago. Her discovery of mystical portals around the city will lead her to a realm unlike anything she's experienced before and bring her face-to-face with a former bearer of the Witchblade! Jump on board with a genre-bending two-parter from the exciting creative team of TIM SEELEY (HACK/SLASH, BLOODSTRIKE) and DIEGO BERNARD (The Man With No Name) that is a perfect jumping-on point for new readers! 

Witchblade #158
On a rescue mission to a world that's the love child of JRR Tolkein and Philip K. Dick, Sara Pezzini races against time to save a life. Can she succeed with a ruthless warlord, a royal entourage, and even a bitter former Witchblade bearer in her way?

